import React, { Component } from 'react';
import Search from './search'

class Main extends Component {
  constructor(props) {
    super(props);

    this.state = {};
   }
  render() {
    return (
      <div className="main">
        <Search></Search>
      </div>
    );
  }
}

export default Main;
